import React, { Fragment } from "react"
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';

function cambiarPuntero(menu) {
    SelectorMenu(menu)
}

const Header = ({SelectorMenu}) => {
    return(
    <Fragment id="header">
        <Navbar bg="dark" data-bs-theme="dark">
            <Container>
                <Navbar.Brand href="#home">MrkUltra</Navbar.Brand>
                <Nav className="me-auto">
                    <Nav.Link onClick={()=>cambiarPunterp("home")}>Home</Nav.Link>
                    <Nav.Link onClick={()=>cambiarPunterp("DNS")}>DNS LookUp</Nav.Link>
                    <Nav.Link onClick={()=>cambiarPunterp("Pass")}>Pasword Managment</Nav.Link>
                </Nav>
            </Container>
        </Navbar>
    </Fragment>)
}
export default Header
